import styled from 'styled-components'

const Div = styled.div`
    display: flex;
    justify-items: center;
    height: 3em;
    width: 10em;
    border-style: solid;
`;

const User = () => {

    const username = localStorage.getItem('username');

    return (
        <Div>
            {username}
        </Div>
    )
}

export default User
